// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface ISwapRouter {
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
}

contract RemittanceContract is Ownable {
    ISwapRouter public swapRouter;
    address public stablecoin; // e.g., USDC address
    
    event RemittanceSent(
        address indexed sender,
        address indexed recipient,
        address sourceToken,
        uint256 sourceAmount,
        address targetToken,
        uint256 targetAmount
    );
    
    constructor(address _swapRouter, address _stablecoin) Ownable(msg.sender) {
        swapRouter = ISwapRouter(_swapRouter);
        stablecoin = _stablecoin;
    }
    
    function sendWithConversion(
        address token,
        uint256 amount,
        address recipient
    ) external {
        // Transfer tokens from sender to this contract
        IERC20(token).transferFrom(msg.sender, address(this), amount);
        
        // If the token is already the stablecoin, just send it directly
        if (token == stablecoin) {
            IERC20(stablecoin).transfer(recipient, amount);
            emit RemittanceSent(msg.sender, recipient, token, amount, stablecoin, amount);
            return;
        }
        
        // Approve router to spend tokens
        IERC20(token).approve(address(swapRouter), amount);
        
        // Prepare path for swap (token -> stablecoin)
        address[] memory path = new address[](2);
        path[0] = token;
        path[1] = stablecoin;
        
        // Swap tokens to stablecoin
        uint[] memory amounts = swapRouter.swapExactTokensForTokens(
            amount,
            0, // Min amount out (should use price oracle in production)
            path,
            address(this),
            block.timestamp + 300 // 5 minute deadline
        );
        
        uint256 stableAmount = amounts[1];
        
        // Send stablecoins to recipient
        IERC20(stablecoin).transfer(recipient, stableAmount);
        
        emit RemittanceSent(msg.sender, recipient, token, amount, stablecoin, stableAmount);
    }
    
    // Allow owner to update router or stablecoin address
    function setSwapRouter(address _swapRouter) external onlyOwner {
        swapRouter = ISwapRouter(_swapRouter);
    }
    
    function setStablecoin(address _stablecoin) external onlyOwner {
        stablecoin = _stablecoin;
    }
}

